module.exports = JSON.parse('[{"id":"house-of-allegiance","title":{"en":"House of Allegiance","ar":" "},"shortDescription":{"en":"Bayt Al-Bay\'ah (House of Allegiance) is one of the historical monuments and tourist attractions in the Al-Ahsa Governorate. It is located in the Al-Kut district in the heart of Al-Hofuf city and was constructed in 1203 AH (1789). The House was the place where the inhabitants of Al-Ahsa swore allegiance to the founding King Abdulaziz bin Abdurrahman, may his soul rest in peace. He stayed in the same house where the people of Al-Ahsa pledged allegiance to him on May 4, 1913. The House has been renovated and turned into a museum to tell the story of Al-Ahsa\'s people\'s allegiance to the Founding King.","ar":"          .             1203 (1789)                  ( )      28   1331/ 4  1913.              ."},"longDescription":{"en":"Bayt Al-Bay\'ah (House of Allegiance) is one of the historical monuments and tourist attractions in the Al-Ahsa Governorate. It is located in the Al-Kut district in the heart of Al-Hofuf city and was constructed in 1203 AH (1789). The House was the place where the inhabitants of Al-Ahsa swore allegiance to the founding King Abdulaziz bin Abdurrahman, may his soul rest in peace. He stayed in the same house where the people of Al-Ahsa pledged allegiance to him on May 4, 1913. The House has been renovated and turned into a museum to tell the story of Al-Ahsa\'s people\'s allegiance to the Founding King.","ar":"          .             1203 (1789)                  ( )      28   1331/ 4  1913.              ."},"image":{"placeholder":"/images/sites/house_of_allegiance.png","url":"/images/sites/house_of_allegiance.png"},"pinImage":"/sites/house-of-allegiance.png","cardImage":"/images/sites/house_of_allegiance_l.png","videoLink":"https://d2vm0afvtrg4mc.cloudfront.net/intro-videos/house-of-allegiance.mp4","geolaction":{"latitude":25.4766738,"longitude":49.2849668},"link":"/house-of-allegiance"},{"id":"ushaiqer-heritage-village","title":{"en":"Ushaiqer Heritage Village","ar":" "},"shortDescription":{"en":"Ushaiqer is one of the oldest villages in Najd. It dates back to the pre-Islamic era and was called \'Akl.\' It is located in the heart of Najd, on an area of oases 200 km northwest of the capital, Riyadh. It reflects the originality and deep-rootedness of Saudi society. Ushaiqer is a small village with limited space and population. It contains a number of schools, shops, and mosques located on its narrow heritage roads. This takes you on a live heritage exploration journey to discover part of the Village\'s originality and heritage.","ar":"            \'\' .                         .                                   ."},"longDescription":{"en":"Ushaiqer is one of the oldest villages in Najd. It dates back to the pre-Islamic era and was called \'Akl.\' It is located in the heart of Najd, on an area of oases 200 km northwest of the capital, Riyadh. It reflects the originality and deep-rootedness of Saudi society. Ushaiqer is a small village with limited space and population. It contains a number of schools, shops, and mosques located on its narrow heritage roads. This takes you on a live heritage exploration journey to discover part of the Village\'s originality and heritage.","ar":"            \'\' .                         .                                   ."},"image":{"placeholder":"/images/sites/ushaiqer.png","url":"/images/sites/ushaiqer.png"},"pinImage":"/sites/ushaiqer-heritage-village.png","cardImage":"/images/sites/ushaiqer_l.png","videoLink":"https://d2vm0afvtrg4mc.cloudfront.net/intro-videos/ushaiqer-heritage-village.mp4","geolaction":{"latitude":25.3398154,"longitude":45.1912727},"link":"/ushaiqer-heritage-village"},{"id":"albassam-heritage-house","title":{"en":"Albassam Heritage House","ar":" "},"shortDescription":{"en":"Al-Bassam Heritage House, located in Unaizah Governorate, has its unique architectural style of Najd. Its building dates back to 1374 AH (1955). It was constructed in two phases, with an area of about 3,500 square meters. It consists of two floors and contains 30 rooms with varying areas. They served as reception rooms, bedrooms, and stores. Al-Bassam House is a unique example of old architecture connoisseurs as it contains an unprecedented system of ventilation and natural lighting.","ar":"                       1374 (1955)    3500        30                             ."},"longDescription":{"en":"Al-Bassam Heritage House, located in Unaizah Governorate, has its unique architectural style of Najd. Its building dates back to 1374 AH (1955). It was constructed in two phases, with an area of about 3,500 square meters. It consists of two floors and contains 30 rooms with varying areas. They served as reception rooms, bedrooms, and stores. Al-Bassam House is a unique example of old architecture connoisseurs as it contains an unprecedented system of ventilation and natural lighting.","ar":"                       1374 (1955)    3500        30                             ."},"image":{"placeholder":"/images/sites/albassam.png","url":"/images/sites/albassam.png"},"pinImage":"/sites/albassam-heritage-house.png","cardImage":"/images/sites/albassam_l.png","videoLink":"https://d2vm0afvtrg4mc.cloudfront.net/intro-videos/albassam-heritage-house.mp4","geolaction":{"latitude":26.08942157,"longitude":43.9674238},"link":"/albassam-heritage-house"},{"id":"aarif-castle","title":{"en":"Aarif Castle","ar":" "},"shortDescription":{"en":"The construction of the A\'arif Fortress dates back to the early 13 th century AH. It is named after A\'arif Mountain, on which it is located. It was built at that time to protect the area and inform fasting locals of the times to break their fast during Ramadan using a cannon. The Fortress consists of a number of towers, stores, rooms, and facilities and typically contains inscriptions on its wooden gates. It was built out of stone, mud, wood, and plaster.","ar":"                                                   440             .            ."},"longDescription":{"en":"The construction of the A\'arif Fortress dates back to the early 13 th century AH. It is named after A\'arif Mountain, on which it is located. It was built at that time to protect the area and inform fasting locals of the times to break their fast during Ramadan using a cannon. The Fortress consists of a number of towers, stores, rooms, and facilities and typically contains inscriptions on its wooden gates. It was built out of stone, mud, wood, and plaster.","ar":"                                                   440             .            ."},"image":{"placeholder":"/images/sites/aarif.png","url":"/images/sites/aarif.png"},"pinImage":"/sites/aarif-fort.png","cardImage":"/images/sites/aarif_l.png","videoLink":"https://d2vm0afvtrg4mc.cloudfront.net/intro-videos/aarif-fort.mp4","geolaction":{"latitude":27.5170025,"longitude":41.7032043},"link":"/aarif-castle"},{"id":"jubbah-and-shuwaymis","title":{"en":"Jubbah and Shuwaymis","ar":"  "},"shortDescription":{"en":"They are among the sites of rock art and ancient writings and are registered as a UNESCO World Heritage Site.","ar":"           ."},"longDescription":{"en":"They are among the sites of rock art and ancient writings and are registered as a UNESCO World Heritage Site.","ar":"           ."},"image":{"placeholder":"/images/sites/jubbah.png","url":"/images/sites/jubbah.png"},"pinImage":"/sites/jubbah-and-shuwaymis.png","cardImage":"/images/sites/jubbah_l.png","videoLink":"https://d2vm0afvtrg4mc.cloudfront.net/intro-videos/jubbah-and-shuwaymis.mp4","geolaction":{"latitude":28.011999308237645,"longitude":40.93242530002401},"link":"/jubbah-and-shuwaymis"},{"id":"zaabal-castle","title":{"en":"Zaabal Castle","ar":" "},"shortDescription":{"en":"The construction of Zaabal Castle dates back to the 1 st century AD. It was built on the ruins of an older castle. The purpose of building it at that time was to protect the trade route. The Castle consists of a wall surrounded and supported by four towers and two rooms. It was built out of mud, stone, and wood on a mountaintop overlooking the area.","ar":"                                               "},"longDescription":{"en":"The construction of Zaabal Castle dates back to the 1 st century AD. It was built on the ruins of an older castle. The purpose of building it at that time was to protect the trade route. The Castle consists of a wall surrounded and supported by four towers and two rooms. It was built out of mud, stone, and wood on a mountaintop overlooking the area.","ar":"                                               "},"image":{"placeholder":"/images/sites/zaabal.png","url":"/images/sites/zaabal.png"},"pinImage":"/sites/zaabal-castle.png","cardImage":"/images/sites/zaabal_l.png","videoLink":"https://d2vm0afvtrg4mc.cloudfront.net/intro-videos/zaabal-castle.mp4","geolaction":{"latitude":30.193080796192362,"longitude":40.40194753921596},"link":"/zaabal-castle"},{"id":"dumat-al-jandal","title":{"en":"Dumat Al-Jandal","ar":"  "},"shortDescription":{"en":"It is an ancient city that attests to successive civilizations from the Stone Age to the Islamic era. The construction of this city dates back to the 8 th century BCE. It includes a museum, the Marid Castle, Ad-Dir\'district, and Umar Mosque.","ar":"                      (      )."},"longDescription":{"en":"It is an ancient city that attests to successive civilizations from the Stone Age to the Islamic era. The construction of this city dates back to the 8 th century BCE. It includes a museum, the Marid Castle, Ad-Dir\'district, and Umar Mosque.","ar":"                      (      )."},"image":{"placeholder":"/images/sites/p_jandal.png","url":"/images/sites/p_jandal.png"},"pinImage":"/sites/jandal.png","cardImage":"/images/sites/jandal.png","videoLink":"https://d2vm0afvtrg4mc.cloudfront.net/intro-videos/Jandal.mp4","geolaction":{"latitude":29.611759192959507,"longitude":39.66720886769519},"link":"/dumat-al-jandal"},{"id":"sour-city","title":{"en":"Sour city (Yanbu)","ar":"   ()"},"shortDescription":{"en":"The construction of the Al-Sour district dates back to the 18 th century AH. The district consists of many heritage houses. It has a variety of Rwasheen and Mashrabiyas with Islamic decorations, manuscripts, and inscriptions. Furthermore, the district includes a number of heritage sites, and it was built out of limestone, wood, and plaster.","ar":"                                                ."},"longDescription":{"en":"The construction of the Al-Sour district dates back to the 18 th century AH. The district consists of many heritage houses. It has a variety of Rwasheen and Mashrabiyas with Islamic decorations, manuscripts, and inscriptions. Furthermore, the district includes a number of heritage sites, and it was built out of limestone, wood, and plaster.","ar":"                                                ."},"image":{"placeholder":"/images/sites/p_sour.png","url":"/images/sites/p_sour.png"},"pinImage":"/sites/sour.png","cardImage":"/images/sites/sour.png","videoLink":"https://d2vm0afvtrg4mc.cloudfront.net/intro-videos/Sour.mp4","geolaction":{"latitude":24.17955676550545,"longitude":37.19079121765208},"link":"/sour-city"},{"id":"thee-ain-ancient-village","title":{"en":"Thee Ain Ancient Village","ar":"   "},"shortDescription":{"en":"Thee Ain is one of the most important heritage villages in the Kingdom. Its 58 palaces are built out of stone on a mountain of white quartz. The Village includes a mosque where the five prayers and Friday prayers are performed.","ar":"                58                 ."},"longDescription":{"en":"Thee Ain is one of the most important heritage villages in the Kingdom. Its 58 palaces are built out of stone on a mountain of white quartz. The Village includes a mosque where the five prayers and Friday prayers are performed.","ar":"                58                 ."},"image":{"placeholder":"/images/sites/p_theeain.png","url":"/images/sites/p_theeain.png"},"pinImage":"/sites/theeain.png","cardImage":"/images/sites/theeain.png","videoLink":"https://d2vm0afvtrg4mc.cloudfront.net/intro-videos/TheeAin.mp4","geolaction":{"latitude":20.03070428727808,"longitude":40.14283967094035},"link":"/thee-ain-ancient-village"},{"id":"adosareyah-castle","title":{"en":"Adosareyah Castle","ar":" "},"shortDescription":{"en":"Al-Dosariyah Castle was constructed in 1225 AH by order of King Abdulaziz, may his soul rest in peace. The Castle received King Faisal, a prince at the time, when he came to Jazan at the head of a military campaign. The Castle is formed of a square-shaped area surrounded by four corner towers, with an open inner courtyard surrounded by rooms of various sizes and purposes, as well as halls. The Castle has two entrances, one on the eastern side and the other on the northern side, as well as basements and a staircase leading to the roof. It was built out of mud, wood, stone, and plaster.","ar":"     1225       -   -       -  -                                                      ."},"longDescription":{"en":"Al-Dosariyah Castle was constructed in 1225 AH by order of King Abdulaziz, may his soul rest in peace. The Castle received King Faisal, a prince at the time, when he came to Jazan at the head of a military campaign. The Castle is formed of a square-shaped area surrounded by four corner towers, with an open inner courtyard surrounded by rooms of various sizes and purposes, as well as halls. The Castle has two entrances, one on the eastern side and the other on the northern side, as well as basements and a staircase leading to the roof. It was built out of mud, wood, stone, and plaster.","ar":"     1225       -   -       -  -                                                      ."},"image":{"placeholder":"/images/sites/p_adosareyah.png","url":"/images/sites/p_adosareyah.png"},"pinImage":"/sites/adosareyah.png","cardImage":"/images/sites/adosareyah.png","videoLink":"https://d2vm0afvtrg4mc.cloudfront.net/intro-videos/Adosareyah.mp4","geolaction":{"latitude":16.98798136668128,"longitude":41.34551176828038},"link":"/adosareyah-castle"},{"id":"al-okhdud","title":{"en":"Al-Okhdood","ar":""},"shortDescription":{"en":"The historical city of Al-Ukhdood, previously known as \'Raqmat,\' is a historic city dating back to the era of the Himyarite Kingdom (110 BC - 525 AD). It is located on the banks of the Najran Valley in the Najran region. The city is noted for the historical massacre that Dhu Nawwas, King of Himyar, carried out against Christians in the region in 520 AD. This story is also told in the Holy Quran.","ar":"      \'\'        (110    525  )                         520           ."},"longDescription":{"en":"The historical city of Al-Ukhdood, previously known as \'Raqmat,\' is a historic city dating back to the era of the Himyarite Kingdom (110 BC - 525 AD). It is located on the banks of the Najran Valley in the Najran region. The city is noted for the historical massacre that Dhu Nawwas, King of Himyar, carried out against Christians in the region in 520 AD. This story is also told in the Holy Quran.","ar":"      \'\'        (110    525  )                         520           ."},"image":{"placeholder":"/images/sites/p_alokhdood.png","url":"/images/sites/p_alokhdood.png"},"pinImage":"/sites/akhdoud.png","cardImage":"/images/sites/alokhdood.png","videoLink":"https://d2vm0afvtrg4mc.cloudfront.net/intro-videos/Al-Okhdood.mp4","geolaction":{"latitude":17.477507897583145,"longitude":44.179304770553564},"link":"/al-okhdud"},{"id":"abarhema","title":{"en":"Bir Hima","ar":" "},"shortDescription":{"en":"It is a site for rock art, ancient and Islamic inscriptions, and ancient archaeological rock wells. It is registered as a UNESCO World Heritage Site.","ar":"              ."},"longDescription":{"en":"It is a site for rock art, ancient and Islamic inscriptions, and ancient archaeological rock wells. It is registered as a UNESCO World Heritage Site.","ar":"              ."},"image":{"placeholder":"/images/sites/p_hima.png","url":"/images/sites/p_hima.png"},"pinImage":"/sites/hima.png","cardImage":"/images/sites/hima.png","videoLink":"https://d2vm0afvtrg4mc.cloudfront.net/intro-videos/Abar-Hima.mp4","geolaction":{"latitude":18.450741321536242,"longitude":44.45113386024912},"link":"/abarhema"},{"id":"al-faw","title":{"en":"Al-Faw","ar":""},"shortDescription":{"en":"Qaryah, as it was previously named, or the present-day Al-Faw Village, is located nearly 700 km southwest of Riyadh and 150 km southeast of Al-Khamasin, Wadi Al-Dawasir. It overlooks the northwest side of the Empty Quarter at the intersection of the Wadi Al-Dawasir and Tuwaiq mountains at a gap in the mountain called Al-Faw. It is located on the old trade route known as the Najran-Jarhaa Route. The Qaryah site is one of the most important archaeological sites throughout the Arabian Peninsula, if not worldwide, because it exemplifies a Pre-Islamic Arab city with all its dwellings, roads, markets, temples, cemeteries, wells and irrigation ditches dating back to the 3 rd century BCE.","ar":" \'\'            700       150       .                                 .   \'\'                                          ."},"longDescription":{"en":"Qaryah, as it was previously named, or the present-day Al-Faw Village, is located nearly 700 km southwest of Riyadh and 150 km southeast of Al-Khamasin, Wadi Al-Dawasir. It overlooks the northwest side of the Empty Quarter at the intersection of the Wadi Al-Dawasir and Tuwaiq mountains at a gap in the mountain called Al-Faw. It is located on the old trade route known as the Najran-Jarhaa Route. The Qaryah site is one of the most important archaeological sites throughout the Arabian Peninsula, if not worldwide, because it exemplifies a Pre-Islamic Arab city with all its dwellings, roads, markets, temples, cemeteries, wells and irrigation ditches dating back to the 3 rd century BCE.","ar":" \'\'            700       150       .                                 .   \'\'                                          ."},"image":{"placeholder":"/images/sites/p_alfaw.png","url":"/images/sites/p_alfaw.png"},"pinImage":"/sites/faw.png","cardImage":"/images/sites/alfaw.png","videoLink":" https://d2vm0afvtrg4mc.cloudfront.net/intro-videos/Al-Faw.mp4","geolaction":{"latitude":19.782295758444263,"longitude":45.14806126860865},"link":"/al-faw"}]');

